const Header = (props) => {
  return <h1>{props.course}</h1>;
};

const Part = (props) => {
  return (
    <p>
      {props.part} {props.exercises}
    </p>
  );
};

const Content = (props) => {
  return (
    <div>
      <Part part={props.part1[0][0]} exercises={props.part1[0][1]} />
      <Part part={props.part2[0][0]} exercises={props.part2[0][1]} />
      <Part part={props.part3[0][0]} exercises={props.part2[0][1]} />
    </div>
  );
};

const Total = (props) => {
  return (
    <p>
      Number of exercises{' '}
      {props.exercises1 + props.exercises2 + props.exercises3}
    </p>
  );
};
const App = () => {
  const course = 'Half Stack application development';
  const part = [
    {
      name: 'Fundamentals of React',
      exercises: 10,
    },
    {
      name: 'Using props to pass data',
      exercises: 7,
    },
    {
      name: 'State of a component',
      exercises: 14,
    },
  ];

  return (
    <div>
      <Header course={course} />

      <Content part1={part[0]} part2={part[1]} part3={part[2]} />

      <Total
        exercises1={part[0][1]}
        exercises2={part[0][1]}
        exercises3={part3.exercises}
      />
    </div>
  );
};
export default App;
